60019',\n'#043927', '#8F9779', '#f1c40f', '#e67e22', '#e74c3c', '#7f8c8d'];\n            // the model that triggered the callback is cb_obj:\n            var b = cb_obj.get(\"active\");\n            var rgbToHex = function(rgb){\n              var hex = Number(rgb).toString(16);\n              if (hex.length < 2) {\n                   hex = \"0\" + hex;\n              }\n              return hex;\n            };\n            var fullColorHex = function(r,g,b) {\n                var red = rgbToHex(r);\n                var green = rgbToHex(g);\n                var blue = rgbToHex(b);\n                return \"#\"+red+green+blue;\n            };\n            // models passed as args are automagically available\n            var data = source.data;\n            var len = data.color.length;\n            var col = [];\n            var othercol = '#1abc9c';\n            if(b === 1){ //Doublon\n                var j = 0;\n                for(i=0;i<len;++i){\n                    if(data.doub[i]){\n                        col.push(colors[j]);\n                        col[i-1] = colors[j];\n                        j++;\n                    }else{col.push(\"#999999\");}\n                }\n                source.data.color = col;\n            }\n            if(b ===2){ //Nans\n                var temp = 0\n                max = Math.max(...data.nans)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * (1 - ((data.nans[i] + 1) / 19)));\n                    col.push(fullColorHex(temp, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 0) { //Cluster\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 3) { //KaKs_Scores\n                max = Math.max(...data.KaKs_Scores)\n                for(i=0;i<len;++i){\n                    // normalizing\n                    temp =  Math.floor(255 * (1 - (data.KaKs_Scores[i] / max)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                source.data.color = col;\n            }\n            if(b === 4){ //similarity_scores\n                max = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"bc46b03d-e6d5-4555-8639-389771405fc2","type":"CustomJS"},{"attributes":{"callback":null,"data":{}},"id":"69dacc36-50a9-4a47-85e2-5b8e842a2785","type":"ColumnDataSource"},{"attributes":{},"id":"7abadb60-949d-4822-a1d8-20d7695133ee","type":"BasicTicker"},{"attributes":{},"id":"99d60b8f-9ee2-4e63-8de3-af2e3f388b7f","type":"WheelZoomTool"},{"attributes":{"callback":null,"column_names":["ecai","lengths","similarity_scores","meanentropy","cai","color","doub","gc","x","y","clusters","nans","species"],"data":{"cai":{"__ndarray__":"irTjYwPV5T+RRPRokfblP/9b/GRAZeg/yTaG8Vpo5j/JGn4XEfblP0zIJeaIRuc/qLZHtzYP5D9O797OaBLmP7Qua1nUpOU/ObJi4YLP4z/nnVkLKKXjP2QTES37Rd8/gygeB2Aq3z9Usyt8JJXjP3tCcqzQNOU/BQEQFj915D8piZX7s43kP1YsD8CeA+M/39kcB/Lx4j9eOQ8o1SfjP2nneLtbKes/iGHqvTLo4D9D7rEeY2HkP29xEgosjOM/Na4YyQsh4z9t5sAYbSfiP0UwEYm1GOQ/K6EqO/db4T+C/krVeJ7iP69PkYcsMuM/gv5K1Xie4j+e/EQuvgrjP8z42RsOUeM/wOg2znRU4z+YSQP9M4/kPxwl5E5vU+M/kCNeSXgL4z+CyT6Un+HiP/xd0cLEhOI/2qfSUxOl4z/ePZknh2DgP3AVmeNnq+M/ZS/SPOH94z8bh6WLVAbhPypKCI0vjuQ/MoxsltZ15D8NrHjp2xLkPwkeV27y/+A/6/kKfyw/4z8DbiS5l8ThP0ONNJ8rt+I/Df+LGeuQ4z/qduAmjSbiP5hZ/HiFu+M/ByM1gu9T4z/MNT1KyXDjP7YoSDbV6eQ/iNSmxVqf5D8pGRc815HjP/EzxB2i1uM/sjdZtd1w5T+TePVIGUfmP5Ztze+kWuU/EnpqlzH35D84xRQDHDzkP9rftcZVXOI/W2hNUz3K4T+O8oZLGAfhP95oLRDWIOM/HLRWH7MI4z8jXOJslL7iPyPmHrTJ4uI/bbwd44Hy4j8/e4XoMcPlP8FJTcAFLeE/ipEOzxik5T+lmy677MPlPw6/d8FAROI/Ji+cBcpY4T8d7pS3QoDfP0kjLQdwQuA/cToLkqMo4T+NXWkrUknpP79zALNDwug/bkmwy1kH6z8R7xI19ozpP6srQr8QW+k/4UljufYJ6j95/BRURT7qP7LAG+n2rek/El1M+5rg6j8lFI1efqboP1FCig/ok+k/i48rkp8y6D87nLJ9c4DnP+VKE12blek/rV6F6XUw6T+G5knMDb3hP9XtcdTrTOE/Hc4bBRMe4z82127e9bjiP7zsVrAaGeE/E0WVgWXq5j9fBpALdIPhP6DRMuek2+A/XdpbK1u/4T8YS6Ma5JnhP2HZ/ufGeeE/AtkR/7+/4j86ytLv+WDnPxiZs8t3AOc/mrQ6M+fG4D8EEDi+vW7iP04WcFkfKeM/YepazmkJ4j/kFYkC28ngPzvUvcO7u+A/gRZ1Pejd4T9VfwpIdgrjPzxY3RqK8OE/Q7Hkty9f3z9/fvP+JbzhP9gp0yO9yt0/ACb6ExIt4j+OeQEE15zgPxDbaSJSq+A/1DT6yfyf4j+rANrPovTiP/rOEyODJt8/Dtw1uLWH
